import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

// Import your logo image (place this in your assets folder)
import logo from '../assets/passporter-logo.png'; 

const quotes = [
  "Travel is the only thing you buy that makes you richer.",
  "Adventure is worthwhile in itself.",
  "The journey is the destination.",
  "Explore. Dream. Discover.",
  "Life is short, and the world is wide.",
];

const MainDashboard = () => {
  const navigate = useNavigate();
  const [currentQuote, setCurrentQuote] = useState('');

  useEffect(() => {
    // Clear localStorage on initial load
    localStorage.removeItem('token');
    localStorage.removeItem('user');

    // Set random quote
    try {
      const randomIndex = Math.floor(Math.random() * quotes.length);
      setCurrentQuote(quotes[randomIndex]);
    } catch (error) {
      console.error('Error setting quote:', error);
      setCurrentQuote(quotes[0]);
    }

    // Redirect logic remains the same...
  }, [navigate]);

  return (
    <div 
      className="min-h-screen flex flex-col"
      style={{
        backgroundImage: "url('https://images.unsplash.com/photo-1501785888041-af3ef285b470?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=2070&q=80')",
        backgroundSize: "cover",
        backgroundPosition: "center",
        backgroundAttachment: "fixed"
      }}
    >
      {/* Navbar */}
      <nav className="fixed top-0 left-0 w-full bg-gradient-to-r from-[#2a1b3d] to-[#1a0b2e] text-white shadow-lg z-20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <div className="flex justify-between h-16 items-center">
            <div className="flex items-center space-x-2">
              <img 
                src={logo} 
                alt="Passporter Logo" 
                className="h-8 w-8" 
              />
              <Link to="/" className="text-2xl font-bold tracking-tight">
                Passporter
              </Link>
            </div>
          </div>
        </div>
      </nav>

      {/* Hero Section with Big Title */}
      <div className="flex-grow flex flex-col items-center justify-center pt-32 pb-16 px-4 text-center">
        <div className="mb-12">
          <img 
            src={logo} 
            alt="Passporter Logo" 
            className="h-24 w-24 mx-auto mb-4" 
          />
          <h1 className="text-6xl font-bold text-white mb-4 animate-fade-in">
            Passporter
          </h1>
          <p className="text-xl text-gray-300 italic max-w-2xl mx-auto">
            {currentQuote || 'Explore. Dream. Discover.'}
          </p>
        </div>

        {/* Cards Section */}
        <div className="flex flex-col md:flex-row gap-8 max-w-6xl w-full px-4">
          {/* Student Card */}
          <Link
            to="/student/login"
            className="glow-border p-8 flex-1 flex flex-col items-center text-center fade-in pulse bg-white bg-opacity-10 backdrop-blur-sm rounded-xl hover:bg-opacity-20 transition-all"
            style={{ animationDelay: '0.2s' }}
          >
            <div className="bg-[#9333ea] p-3 rounded-full mb-4">
              <svg
                className="h-10 w-10 text-white"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d="M16 7a4 4 0 11-8 0 4 4 0 018 0zm-4 7a7 7 0 00-7 7h14a7 7 0 00-7-7z"
                />
              </svg>
            </div>
            <h2 className="text-2xl font-bold text-white">Student Hub</h2>
            <p className="mt-2 text-gray-300">"Empower Your Wings"</p>
          </Link>

          {/* Advisor Card */}
          <Link
            to="/advisor/login"
            className="glow-border p-8 flex-1 flex flex-col items-center text-center fade-in pulse bg-white bg-opacity-10 backdrop-blur-sm rounded-xl hover:bg-opacity-20 transition-all"
            style={{ animationDelay: '0.4s' }}
          >
            <div className="bg-[#9333ea] p-3 rounded-full mb-4">
              <svg
                className="h-10 w-10 text-white"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d="M12 6.253v13m0-13C10.832 5.477 9.246 5 7.5 5S4.168 5.477 3 6.253v13C4.168 18.477 5.754 18 7.5 18s3.332.477 4.5 1.253m0-13C13.168 5.477 14.754 5 16.5 5s3.332.477 4.5 1.253v13C19.832 18.477 18.246 18 16.5 18s-3.332.477-4.5 1.253"
                />
              </svg>
            </div>
            <h2 className="text-2xl font-bold text-white">Advisor Portal</h2>
            <p className="mt-2 text-gray-300">"Guide with Wisdom"</p>
          </Link>

          {/* Warden Card */}
          <Link
            to="/warden/login"
            className="glow-border p-8 flex-1 flex flex-col items-center text-center fade-in pulse bg-white bg-opacity-10 backdrop-blur-sm rounded-xl hover:bg-opacity-20 transition-all"
            style={{ animationDelay: '0.6s' }}
          >
            <div className="bg-[#9333ea] p-3 rounded-full mb-4">
              <svg
                className="h-10 w-10 text-white"
                fill="none"
                stroke="currentColor"
                viewBox="0 0 24 24"
              >
                <path
                  strokeLinecap="round"
                  strokeLinejoin="round"
                  strokeWidth="2"
                  d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z"
                />
              </svg>
            </div>
            <h2 className="text-2xl font-bold text-white">Warden Command</h2>
            <p className="mt-2 text-gray-300">"Guard with Authority"</p>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default MainDashboard;
